import React from 'react';
import { SafeAreaProvider, SafeAreaView } from 'react-native-safe-area-context';
import Navigation from './src/navigation';

const App = () => {
  return (
    <SafeAreaProvider>
      <SafeAreaView >
        <Navigation />
      </SafeAreaView>  
    </SafeAreaProvider>

  );
}



export default App;
